window.bookSummaryJSON = "<p><b>They're everything she never knew she needed. Good thing&nbsp;they're hers to keep....</b></p> <p>When Sascha heads for a job interview, she has no idea that her life is about to change. There's more at stake than just a job here. With five sexy geniuses as her new bosses, she has two choices. Keep things platonic, or make things a bit more interesting.</p> <p>But when she <i>does</i> decide to be more than just a housekeeper to her sexy new employers, she triggers events she could never have foreseen. With five men to protect her, she <i>should</i> be safe, but there's an outside threat that has the potential to destroy them.</p> <p>But can Sascha's men protect her?</p>"; 
